import React, { Component } from 'react'





class EventBind extends Component {
    constructor(props){
        super(props)

        this.state = {
            message:"hello"

        }
    }
    render() {
        return (
            <div>
                {this.state.message}
            <button onClick={this.state.message}>click</button> 
            </div>
        )
    }
}

export default EventBind
